GL::GL()
{
    std::for_each_n(__GLEntryPoints, std::size(__GLEntryPoints),
                    ClearEntryPoint(this));
}

void GL::resolveEntryPoints(const APIResolver *resolver)
{
    std::for_each_n(__GLEntryPoints, std::size(__GLEntryPoints),
                    ResolveEntryPoint(this, resolver));
}

